import "./style.css";

function App() {
  return (
    <>
    <header className="header" >  
        <div className="logo">
        <img src="logo.png" height="68" width="68" alt=""/>
        <h1>Today I Learned</h1>
        </div>
        <button className="btn btn-open">Share a Fact</button>
        </header>

      <CategoryFilter/>
      </>
  );
}

function CategoryFilter(){
    return (<aside>category filter</aside>);
}

export default App;
